import React from 'react';
import LevelItem from './LevelItem';
import RightArrow from '../../assets/images/arrow-right.svg';

function LevelBanner({ category, currentLevel }) {
    return (
        <>
            <div className={`relative ${category.level} text-white w-2/3 rounded-lg px-5 py-4 mx-auto mt-7`}>
                <h2 className='font-bold text-3xl text-white'>{category.title}</h2>
                <p className='font-semibold text-blue-100'>{category.description}</p>
                <a href='play.html' className='absolute right-4 bottom-3 size-10'>
                    <img src={RightArrow} alt='continue learning' />
                </a>
            </div>
            {/* <ul className="mt-5 text-center">
                {levelItems.map((level) => (
                <LevelItem key={level.id} {...level} />
                ))}
            </ul> */}
        </>
    );
}

export default LevelBanner;
